import React, { Component, Fragment } from 'react';
import TwoBoxes from '../component/box';
import './App.css';

class MainPage extends Component{
  render () {
    return (
      <TwoBoxes
        left={
          <Userinfo />
        }
        right={
          <ShowTweets />
        } />
    );
  }
}

export default MainPage;
